import React from "react";
import "../AppTitle/AppTitle.css";
import App from "../../App";
import { useState, useEffect } from "react";

const AppTitle = () => {
  const [showSecondWord, setShowSecondWord] = useState(false);

  useEffect(() => {
    // Wait for the "Welcome to" animation to finish before starting "TerraSomething"
    const timer = setTimeout(() => {
      setShowSecondWord(true);
    }, 3000); // Adjust based on the duration of the "Welcome to" animation

    return () => clearTimeout(timer);
  }, []);

  return (
    <div>
      <h1 className="typing-container">
        <span className="typing" style={{ animationDuration: "3s" }}>
          Welcome to
        </span>
        {showSecondWord && (
          <span
            className="typing cursor new-line"
            style={{ animationDelay: "0s", animationDuration: "3s" }}
          >
            TerraSomething
          </span>
        )}
      </h1>
    </div>
  );
};

export default AppTitle;
